import React from "react";

const CarDetails = ({ car, similarCars }) => {
  return (
    <div>
      <h1>{car.name}</h1>
      <img src={car.images[0].image_url} alt={car.name} />
      <p>{car.description}</p>

      <h2>السيارات المشابهة</h2>
      <div>
        {similarCars.map((similarCar) => (
          <div key={similarCar.id}>
            <h3>{similarCar.name}</h3>
            <img src={similarCar.images[0].image_url} alt={similarCar.name} />
          </div>
        ))}
      </div>
    </div>
  );
};


export default About;
